export function fromObj(o) {
  const result = [];
  // tslint:disable-next-line: forin
  for (const key in o) {
    result.push({
      label: o[key],
      value: key
    });
  }
  return result;
}
export function fromObjWithNum(o) {
  const result = [];
  // tslint:disable-next-line: forin
  for (const key in o) {
    result.push({
      label: o[key],
      value: +key
    });
  }
  return result;
}
